var title_f39_40_40586="EP study tracings during atrial tachycardia mapping";
var content_f39_40_40586=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F58120%7ECARD%2F50219%7ECARD%2F82052&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F58120%7ECARD%2F50219%7ECARD%2F82052&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1154px;\">",
"  <div class=\"figure\" style=\"width: 584px\">",
"   <div class=\"ttl\">",
"    Electrophysiologic (EP) tracing during mapping of atrial tachycardia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 564px; height: 407px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown are three surface ECG leads (I, aVF, V1) and intracardiac recordings from the high posterior right atrium (HRA); posterior left atrium (USER1 and USER 3); proximal, mid, and distal coronary sinus (CS9-10, CS5-6, CS1-2); and right ventricular apex (RVA). The patient had an incessant atrial tachycardia and dilated cardiomyopathy (left ventricular ejection fraction 9 percent) referred for cardiac transplant evaluation. The P wave (*) falls at the end of the T wave in the surface ECG; its onset is difficult to discern. However, the intracardiac electrograms demonstrate obvious atrial (A) and ventricular (V) activity. Activation mapping involves positioning the mapping catheters in the right (HRA) and left atria (USER) to record earliest electrical activity during the tachycardia. The left atrial catheter records earlier electrical activity (arrow) than the right atrial catheter, but the timing with respect to the surface P wave is obscured because of the T wave of the preceding QRS complex.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal rhythm strip",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 165px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal rhythm strip in lead II. The PR interval is 0.15 sec and the QRS duration is 0.08 sec. Both the P and T waves are upright.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton F Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 602px\">",
"   <div class=\"ttl\">",
"    Electrophysiologic (EP) study tracing showng a ventricular premature beat (VPB) during mapping of an atrial tachycardia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 582px; height: 420px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Three surface ECG leads (I, aVF, V1) and intracardiac recordings from the high posterior right atrium (HRA); posterior left atrium (USER1 and USER 3); proximal, mid, and distal coronary sinus (CS9-10, CS5-6, CS1-2); and right ventricular apex (RVA) in a patient with atrial tachycardia. A ventricular premature beat (VPB) introduced from the right ventricular outflow tract has no effect on the underlying atrial tachycardia, but the onset of the P wave (P) in the surface ECG recordings can be seen more clearly as it is no longer superimposed on the T wave. The atrial electrogram (A) recorded from the right atrial catheter precedes the surface P wave by 30 msec, but the signal from the left atrial catheter (USER1) precedes the surface P wave by 50 msec (arrow).",
"    <div class=\"footnotes\">",
"     V: ventricular electrogram.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 560px\">",
"   <div class=\"ttl\">",
"    Electrophysiology (EP) study tracing obtained during radiofrequency catheter ablation of atrial tachycardia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 540px; height: 388px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Three surface ECG leads (I, aVF, V1) and intracardiac recordings from the high posterior right atrium (HRA); posterior left atrium (USER1 and USER 3); proximal, mid, and distal coronary sinus (CS9-10, CS5-6, CS1-2); and right ventricular apex (RVA) in a patient with atrial tachycardia. Radiofrequency energy application at the left atrial site of earliest atrial activation (USER1) causes initial rate acceleration, consistent with heating of an automatic focus; this is followed by abrupt termination (*) of the atrial tachycardia, resulting in a junctional rhythm. The patient had no further tachycardia during follow-up and left ventricular function returned to normal within four months of the ablation procedure, confirming that the cardiomyopathy was tachycardia induced.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
